import React from "react";
import Header from "./Header";
import Card from "@mui/material/Card";
import Grid from "@mui/material/Grid";
import TextField from "@mui/material/TextField";
import Typography from "@mui/material/Typography";
import { Button } from "@mui/material";
import { Link } from "react-router-dom";
import Newsletter from "./Newsletter";
import Footer from "./Footer";
import Box from "@mui/material/Box";

const Signup = () => {
  return (
    <>
      <Header />
      <Grid container justifyContent="center">
        <Grid item xs={12} sm={10} md={8}>
          <form method="POST">
            <Card
              sx={{
                background: "#f3f6fd",
                color: "black",
                borderRadius: 4,
                display: "flex",
                flexDirection: "column",
                alignItems: "center",
                justifyContent: "center",
                padding: 2,
                width: "100%",
                marginTop: "100px",
                marginBottom: "15px",
              }}
            >
              <Typography
                variant="h6"
                component="h6"
                sx={{
                  color: "#818090",
                  textAlign: "center",
                  position: "relative",
                }}
              >
                Register account
              </Typography>
              <Typography
                variant="h4"
                component="h4"
                sx={{
                  color: "black",
                  textAlign: "center",
                  position: "relative",
                  margin: "10px",
                }}
              >
                Register your account
              </Typography>
              <Grid container justifyContent="center">
                <Grid
                  item
                  xs={12}
                  sm={12}
                  sx={{ display: "flex", justifyContent: "center" }}
                >
                  <TextField
                    required
                    label="Enter first name"
                    variant="outlined"
                    color="secondary"
                    sx={{
                      width: "70%",
                      mt: { xs: 3, sm: 2, md: 2 },
                      mb: { sm: 2, md: 2 },
                    }}
                  />
                </Grid>
                <Grid
                  item
                  xs={12}
                  sm={12}
                  sx={{ display: "flex", justifyContent: "center" }}
                >
                  <TextField
                    required
                    label="Enter last name"
                    variant="outlined"
                    color="secondary"
                    sx={{
                      width: "70%",
                      mt: { xs: 3, sm: 2, md: 1 },
                      mb: { sm: 2, md: 2 },
                    }}
                  />
                </Grid>
                <Grid
                  item
                  xs={12}
                  sm={12}
                  sx={{ display: "flex", justifyContent: "center" }}
                >
                  <TextField
                    label="Email address (Optional)"
                    variant="outlined"
                    color="secondary"
                    sx={{
                      width: "70%",
                      mt: { xs: 3, sm: 2, md: 1 },
                      mb: { sm: 2, md: 2 },
                    }}
                  />
                </Grid>
                <Grid
                  item
                  xs={12}
                  sm={12}
                  sx={{ display: "flex", justifyContent: "center" }}
                >
                  <TextField
                    required
                    label="Mobile Number"
                    variant="outlined"
                    color="secondary"
                    sx={{
                      width: "70%",
                      mt: { xs: 3, sm: 2, md: 1 },
                      mb: { sm: 2, md: 2 },
                    }}
                  />
                </Grid>
                <Grid
                  item
                  xs={12}
                  sm={12}
                  sx={{ display: "flex", justifyContent: "center" }}
                >
                  <TextField
                    required
                    label="User name"
                    variant="outlined"
                    color="secondary"
                    sx={{
                      width: "70%",
                      mt: { xs: 3, sm: 2, md: 1 },
                      mb: { sm: 2, md: 2 },
                    }}
                  />
                </Grid>
                <Grid
                  item
                  xs={12}
                  sm={12}
                  sx={{ display: "flex", justifyContent: "center" }}
                >
                  <TextField
                    required
                    label="Password"
                    variant="outlined"
                    color="secondary"
                    sx={{
                      width: "70%",
                      mt: { xs: 3, sm: 2, md: 1 },
                      mb: { sm: 2, md: 2 },
                    }}
                  />
                </Grid>
                <Grid
                  item
                  xs={6}
                  sm={6}
                  md={6}
                  lg={6}
                  sx={{ display: "flex", justifyContent: "center" }}
                >
                  <Button
                    variant="contained"
                    size="large"
                    color="secondary"
                    sx={{
                      paddingRight: "30px",
                      mt: 3,
                      mb: 3,
                      justifyContent: "center",
                      textTransform: "capitalize",
                      fontSize: "18px",
                      ":hover": {
                        backgroundColor: "#212529",
                      },
                    }}
                  >
                    Register
                  </Button>
                </Grid>
                <Box
                  sx={{
                    position: "relative",
                    "&::after": {
                      content: '""',
                      position: "absolute",
                      width: "200px",
                      height: "1px",
                      background: "#dddddd",
                      left: "calc(30% - 100px)",
                      top: "100px",
                    },
                  }}
                />
                <Typography
                    variant="p"
                    component="p"
                    sx={{
                      color: "#818090",
                      textAlign: "center",
                      position: "relative",
                      margin: "10px",
                    }}
                  >
                    or
                    </Typography>
                {/* <Box
                  sx={{
                    position: "relative",
                    "&::after": {
                      content: '""',
                      position: "absolute",
                      width: "200px",
                      height: "1px",
                      background: "#dddddd",
                      right: "calc(30% - 100px)",
                      top: "100px",
                    },
                  }}
                /> */}
                <Grid item xs={12} sm={12} md={12} lg={12}>
                  <Typography
                    variant="p"
                    component="p"
                    sx={{
                      color: "#818090",
                      textAlign: "center",
                      position: "relative",
                      margin: "10px",
                    }}
                  >
                    Already have an account?
                    <Link
                      to="/register"
                      style={{
                        color: "#8b3eea",
                        textDecoration: "none",
                      }}
                    >
                      Log in Now
                    </Link>
                  </Typography>
                </Grid>
              </Grid>
            </Card>
          </form>
        </Grid>
        <Newsletter />
        <Footer />
      </Grid>
    </>
  );
};

export default Signup;
